import React from 'react';
import PlanetCard from './PlanetCard'

const Content = ({planets}) => {
    return (
        <div>
            <PlanetCard name={planets.name} terrain={planets.terrain} gravity={planets.gravity} climate={planets.climate} />
        </div>
    );
}

export default Content;
